import React from 'react';

const Tweet_list = (props) => {
    return(
        <ul>
            <li>트윗</li>
            <li>트윗 및 답글</li>
            <li>미디어</li>
            <li>마음에 들어요</li>
        </ul>
    )
};

export default Tweet_list;
